}

class App extends Component {
  render() {
    return (
      	<div className="App">
        	<Header/>
        	<HomeAnimation/>
			<div className="interactiveOpen" onClick="">
				<FontAwesomeIcon id="infoOpen" className="icon" icon={faInfoCircle} />
				<FontAwesomeIcon id="infoClose" className="icon" icon={faTimesCircle} />
			</div>
			<InteractiveContainer/>
      	</div>
    );
  }
}

export default App;
